import './App.css';
import {BrowserRouter,Switch,Route} from "react-router-dom";
// import Home from "./pages/Home";

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Switch>
        <Route exact path="/" component={Home} />

      </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
